import React, { useState } from "react";
import * as S from "./styled";
export default function Input({ passWordEyes, ...rest }) {
  const [eye, setEye] = useState(false);

  if (passWordEyes) {
    return (
      <>
        <S.InputPassword {...rest} />
        <S.WrapEyes onClick={setEye(!eye)}>
          {eye && <i className="far fa-eye" />}

          <i className="far fa-eye-slash" />
        </S.WrapEyes>
      </>
    );
  }
  return (
    <>
      <S.Input {...rest} />
    </>
  );
}
